import os
import json
import numpy as np

#Collate individual files into a single large file for faster read in.

dependency_changes_path = 'dep-contri_congruence/Ecosystem_congruence_analysis(RQ1)/dependencies_changes_quarter'
package_info_path = 'dep-contri_congruence/Ecosystem_congruence_analysis(RQ1)/packages_info.json'


dependency_changes_data = {}

#map repo names to package names
f = open (package_info_path, "r")
data = json.loads(f.read())
repo_to_package_names = {}
for i in data:
    repo = data[i][1]
    package_name = i
    repo_to_package_names[repo] = package_name


not_found = []
i = 0 
fileList = os.listdir(dependency_changes_path)
for file in fileList:
    if file.endswith(".json"):
        i+=1
        repo_name = file.split(".")[0].replace('___', ':')
        try:
            package_name = repo_to_package_names[repo_name]
        except:
            not_found.append(repo_name)
            continue
        dependency_changes = json.load(open(dependency_changes_path + "/" + file))
        dependency_changes_data[repo_name] = {}
        dependency_changes_data[repo_name]['package_name'] = package_name
        dependency_changes_data[repo_name]['dependencies_changes_quarter'] = dependency_changes

print("Repos missing:" , len(not_found))
print(not_found)

f = open("dependencies.json", "w")
f.write(json.dumps(dependency_changes_data))

